import React from 'react';
import { MDBContainer, MDBMask, MDBBtn, MDBView, MDBRow, MDBCol, MDBCardBody, MDBIcon } from 'mdbreact';

class About extends React.Component {

    render() {  
        return (
            <div ClassName="AboutMeWrapper">
                <MDBContainer>
                    <h1>About Me</h1>
                </MDBContainer>
            </div>   
        );
    }
}

export default About;
